import React from 'react'
import { Button, Card } from 'react-bootstrap'
import foto from '../../assets/image/avatar.png'
import DataProject from './DataProject.json'
import { ProjectList } from './Project.style'

export default function Project() {
  return (
    <ProjectList>
        {
            DataProject.map( data => {
                return(
                    <Card style={{ width: '18rem' }}>
                    <Card.Img variant="top" src={data.src.to}/>
                    <Card.Body>
                        <Card.Title>{data.src}</Card.Title>
                        <Card.Text>
                        Some quick example text to build on the card title and make up the bulk of
                        the card's content.
                        </Card.Text>
                        <Button variant="primary">Go somewhere</Button>
                    </Card.Body>
                </Card>
                )
            })
        }
    </ProjectList>
  )
}
